import React, { useEffect, useState } from "react";
import "./HomePage.css";

const HomePage = ({ user }) => {
  const { userName } = user;
  const firstName = userName.split(" ").slice(0, 1);

  return (
    <div>
      <header>Welcome {firstName}!</header>
      <main>
        <h2>Top Stories</h2>
      </main>
    </div>
  );
};

export default HomePage;
